import NewsFeedFilter from './NewsFeedFilter.js'
import FeedSectionMain from './FeedSectionMain'
import Buttons from './Buttons.js'
import RoundProfileImage from './RoundProfileImage'
import profileImage from '../img/profileImage.jpg';
import '../css/profilePage.css';
// import UserDetails from './UserDetails'
// import ItemView from './components/ItemView'

// functional components
const  ProfilePage = () => {



    return (
    <>
       <section className="profilePageContainer">
       <Buttons className="profileButtons" text={'Submit a Request'}/>
       <span className="profile_image_container"><RoundProfileImage username={'Tweedy Bird'}  imageURL={profileImage}/></span>
       <Buttons className="profileButtons" text={'Donate an Item'}/>
      </section>
      <section className='FilterC'>
             <NewsFeedFilter/>
      </section>
      <section>
      <FeedSectionMain />






      </section>




    </>
    );
}



export default ProfilePage
